function Login(){
    return(
        <div className="container flex flex_ver flex_center_all">
            <div>Welcome, Recycler</div>
            <form>
                <div>
                    <label>User Name</label>
                    <input type="text" required id="username" />
                </div>
            </form>
        </div>
    );
}
export default Login;
